import React, { useState } from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { Link, Navbar, Nav } from 'react-bootstrap';


const Signup = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [result, setResult] = useState(null);
    const [error, setError] = useState(null);

    const handleSubmit = async (e) => {
        e.preventDefault();
        const url = 'https://json-storage-api.p.rapidapi.com/datalake';
        const options = {
            method: 'POST',
            headers: {
                'content-type': 'application/json',
                'X-RapidAPI-Key': '66d105c179msh9c5b82c1cf62460p15aa72jsn63c558e1dc1e',
                'X-RapidAPI-Host': 'json-storage-api.p.rapidapi.com'
            },
            body: {
                '@context': [
                    'http://schema4i.org/Thing.jsonld',
                    'http://schema4i.org/Action.jsonld',
                    'http://schema4i.org/CreateAction.jsonld'
                ],
                '@type': 'CreateAction',
                Result: {
                    '@context': [
                        'http://schema4i.org/DataLakeItem.jsonld',
                        'http://schema4i.org/UserAccount.jsonld',
                        'http://schema4i.org/OfferForPurchase.jsonld',
                        'http://schema4i.org/Offer.jsonld',
                        'http://schema4i.org/Organization.jsonld',
                        'http://schema4i.org/PostalAddress.jsonld'
                    ],
                    '@type': 'DataLakeItem',
                    Name: 'X-PLOR Group',
                    Creator: {
                        '@type': 'UserAccount',
                        Identifier: 'USERID-4711'
                    },
                    About: {
                        '@type': 'Organization',
                        Username: username,
                        Password: password
                    }
                }
            }
        };

        try {
            const response = await fetch(url, options);
            const result = await response.text();
            console.log(result);
        } catch (error) {
            console.error(error);
        }
    };

    return (
        <Row>
            <Container fluid>
                <Col md={0}></Col>
                <Col md={20}>
                    <form onSubmit={handleSubmit}>
                        <div className="bg-image">
                            <div className="row row-cols-1 row-cols-md-2 g-4">
                                <div className="col shadow p-3 mb-5 bg-body-tertiary rounded fromtable">
                                    <div className="mb-3 login">
                                        <h4 style={{ padding: "10px" }}>Sign in</h4>
                                        <label htmlFor="username" className="form-label" style={{ padding: "10px" }}>User Name</label>
                                        <input
                                            type="text"
                                            value={username}
                                            onChange={(e) => setUsername(e.target.value)}
                                        />
                                        <label htmlFor="password" className="form-label" style={{ padding: "10px" }}>Password</label>
                                        <input
                                            type="password"
                                            value={password}
                                            onChange={(e) => setPassword(e.target.value)}
                                        />
                                        <br />
                                        <br />
                                        <Nav.Link to="/Transaction">
                                         <button className="btn btn-secondary">Sign up</button>
                                        </Nav.Link>
                                    </div>
                                    {error && <p>Error: {error.message}</p>}
                                    {result && <pre>{result}</pre>}
                                    <br />
                                    <br />
                                    <br />
                                </div>
                            </div>
                        </div>
                    </form>
                </Col>
            </Container>
        </Row>
    );
};

export default Signup;
